import React from "react";
import { Route, BrowserRouter } from "react-router-dom";
import { HomePage } from "./HomePage/HomePage.jsx";

export const Routes = () => {
  return (
    <BrowserRouter>
        <Routes>
        <Route component={HomePage} path="/" exact />
        </Routes>
    </BrowserRouter>
  );
};
